import { createRoot } from "react-dom/client";
import { App } from "./App";
import "react-multi-carousel/lib/styles.css";
import { RecoilRoot } from "recoil";

const rootNode = document.getElementById("root");

if (rootNode) {
  createRoot(rootNode).render(
    <RecoilRoot>
      <App />
    </RecoilRoot>
  );
}
